import React from "react";
import { StyledCell } from "./styles/styledCell";
import { TETROMINOS } from "../tetrominos";
import b1 from "../img/pokeball-T.png"

// export default function Cell({ type }) {

//   return (
//     <StyledCell type={type} color={TETROMINOS[type].color} />
//   )
// };

// const Cell = ({ type }) => (
//   <StyledCell type={type} color={TETROMINOS[type].color} />
// );
// export default Cell;

const Cell = ({ type }) => (
  <StyledCell type={type}>
    {type === "I" && <img src={b1} alt="I shape" />}
    {type === "J" && <img src={b1} alt="J shape" />}
    {type === "L" && <img src={b1} alt="L shape" />}
    {type === "O" && <img src={b1} alt="O shape" />}
    {type === "S" && <img src={b1} alt="S shape" />}
    {type === "T" && <img src={b1} alt="T shape" />}
    {type === "Z" && <img src={b1} alt="Z shape" />}
    {type === 0 && <img src={b1} alt="Empty Cell" />}
  </StyledCell>
);
//   <StyledCell type={type} color={TETROMINOS[type].color }></StyledCell>
// );

export default React.memo(Cell);
